import React from 'react';

export default class NavBar  extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            navs: [
                { title: 'Home', href: '' },
                { title: 'About', href: '' },
                { title: 'Reviews', href: '' },
                { title: 'Store', href: '' },
            ],
        };
    }

    render() {
        return (
            <div>
                NavBar
            </div>
        );
    }
}
